// App.js
import React from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import { Container, Navbar, Nav,  } from 'react-bootstrap';
import Nom from './Nom';
import Prix from './Prix';
import Description from './Description';
import Image from './image';

const App = () => {
  const produit = {
    nom: "Nom du produit",
    prix: 19.99,
    description: "Description du produit.",
    image: "url_de_l_image.jpg",
    altText: "Image du produit",
  };

  return (

      <div className="App">
      <Navbar bg="info" expand="lg">
        <Container>
          <Navbar.Brand href="#home">Produit APP</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#home">Menu</Nav.Link>
              <Nav.Link href="#link">ACCueil</Nav.Link>
              <Nav.Link href="#about">About</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <Nom nomProduit={produit.nom} />
      <Prix prixProduit={produit.prix} />
      <Image imageProduit={produit.image} altText={produit.altText} />
      <Description descriptionProduit={produit.description} />

    </div>
  );
};

export default App;
